# TODO: Generate source files from static images

bits = ""

output = ""

output = "static OUTPUT: [u8; "
output += str(len(bits))
output += "] = ["

index = 0

while True:
	substring = bits[index:index+8]
	value = int(substring, 2)
	output += str(value)
	output += ", "
	index += 8

	if (index >= len(bits)):
		break

output += "];"

print(output)
